import React from "react";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div>
      <Navbar />
      <img
              src='https://3.bp.blogspot.com/-sM393c3a8WE/Xb0x0faU6nI/AAAAAAAAGeg/cCYU8sZwSFkqSuhAeOfPM5tNHKtFxBb0wCLcBGAsYHQ/s1600-rw/00-Photoshop-Turn-a-Photo-into-a-Hexagon-Collage-600x400-min.jpg'
        alt="https://website.picbow.com/images/photo-grid-online/photo-collage-girl.png"
      />
    </div>
  );
};

export default App;
